import React from 'react';
import * as css from './component.css'
import './Button.module.css';

export const Button = (props) => {
return (
	<button
	className={styles.button}
	type={props.type||'button'}
	onClick={props.onClick}
	>
		{props.children}
	</button>
);
}

export default Button;
